export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:5}}},McEgZuLDoK:{data:{id:1991,attributes:{imdbId:"tt0250371",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNjA0NTY1NzM2MV5BMl5BanBnXkFtZTgwMzgyMzYzNTE@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"6.4\u002F10"},{Source:"Rotten Tomatoes",Value:"30%"},{Source:"Metacritic",Value:"38\u002F100"}],item_lang:{data:{id:2654,attributes:{title:g,plot:"John H. Groberg, a middle class kid from Idaho Falls, crosses the Pacific to become a Church of Jesus Christ of Latter-Day Saint missionary in the remote and exotic Tongan island kingdom during the 1950's. He leaves behind a loving family and the true love of his life, Jean. Through letters and musings across the miles, John shares his humbling and sometimes hilarious adventures with \"the girl back home\", and her letters buoy up his spirits in difficult times. John must struggle to overcome language barriers, physical hardship and deep-rooted suspicion to earn the trust and love of the Tongan people he has come to serve. Throughout his adventure-filled three years on the islands, he discovers friends and wisdom in the most unlikely places. John H. Groberg's Tongan odyssey will change his life forever.",slug:"the-other-side-of-heaven"}}},books:{data:[{id:1295,attributes:{title:"In the Eye of the Storm",description:a,thumbnail:a,authors:[b],firstBook:true,published:"1993-01-01",publisher:"Bookcraft, Incorporated",subtitle:a}},{id:1296,attributes:{title:"A Christmas on the Other Side of Heaven",description:"It's Christmas Eve 1950 in Tonga, and young Elder Groberg is a long, long way from home. Separated from family and the girl he loves, he's not at all sure that this Christmas is going to be a very merry one. But when he and his companion discover an opportunity to make a special sacrifice, he finds the true meaning of Christmas in thejoy of service. More than 100,000 copies have been sold of Elder Groberg's inspiring missionary story, The Other Side of Heaven, now a major motion picture. This holiday story is adapted from an episode in that book.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=3GR5gZNYDkkC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"2004-10-01",publisher:a,subtitle:a}},{id:1297,attributes:{title:g,description:"This first-person account tells the fascinating story of the three years Elder Groberg spent on the islands in the South Pacific amidst a kindly people who had a deep faith in God, a faith that provides the backdrop for Elder Groberg's accounts of miraculous healings, protective warnings, and perilous voyages; for such stories as: The emergancy night voyage on a turbulent sea, and the anxious search for the only guiding light into the destination harbor. The boy whose apparently lifeless body was handed to the missionaries with the words, \"Here, make him well again you have the power.\" The storm that overturned the boat, throwing missionaries into the raging sea. The hurricane that hit the little island. The hunger when the usual supply boat failed to show up. And much, much more. This remarkable book paints a vivid picture of missionary life in a society geared to \"a different way of thinking.\"",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Cc9Y_HXKBk8C&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"2001-01-01",publisher:h,subtitle:a}},{id:1298,attributes:{title:"The Fire of Faith",description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=V7-QegmqEFQC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"2002-10-01",publisher:h,subtitle:"The Memoirs of John H. Groberg"}},{id:1299,attributes:{title:"Anytime, Anywhere",description:"Shortly before general conference in April 1976, President Spencer W. Kimball called John H. Groberg to serve as a full-time General Authority. Stunned, the only question the newly called Elder Groberg could think to ask was, Does this mean we will have to leave Idaho Falls? President Kimball hugged him and said tenderly, I know exactly how you feel. It is good to love your hometown and your roots, but yes, this will mean moving anytime, anywhere in the whole world, for the rest of your life.Filled with Elder Grobergs trademark inspirational stories, this book takes us from Mongolia to Argentina. Fascinating insights into the lives of Saints across the globe, all from a firsthand perspective, testify of the reality of miracles in our day.Few of us will be called upon to serve as General Authorities, but anyone who has made gospel covenants has made the same promise to do the Lords will, whatever it may be. Learn how Gods children throughout the world are blessed as theyand wekeep the covenants we have made to serve anytime, anywhere!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=PqjtAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"2006-01-01",publisher:"Shadow Mountain",subtitle:a}}]}}},meta:{}}},prerenderedAt:1681309559680}}("","John H. Groberg","movie",null,"series",1,"The Other Side of Heaven","Deseret Book Company"))